-(void)GetDataActiveUsers:(BOOL)CheckingRetentionUsers {
    
    NSMutableArray *userAnalyticsArray = [NSMutableArray array];
    
    FIRFirestore *defaultFirestore = [FIRFirestore firestore];
    
    [[[[defaultFirestore collectionWithPath:@"Analytics"] queryLimitedToLast:500] queryOrderedByField:@"MixPanelID"] getDocumentsWithCompletion:^(FIRQuerySnapshot * _Nullable snapshot, NSError * _Nullable error) {
        
        for (FIRDocumentSnapshot *doc in snapshot.documents) {
            
            [userAnalyticsArray addObject:doc.data];
            
        }
        
        [self ActiveUsersInitial:userAnalyticsArray CheckingRetentionUsers:CheckingRetentionUsers];
        
    }];
    
}

-(void)GetDataLastNumberOfMixPanelIDs:(int)number {
    
    FIRFirestore *defaultFirestore = [FIRFirestore firestore];
    
    [[[[defaultFirestore collectionWithPath:@"Analytics"] queryLimitedToLast:number] queryOrderedByField:@"MixPanelID"] getDocumentsWithCompletion:^(FIRQuerySnapshot * _Nullable snapshot, NSError * _Nullable error) {
        
