-(void)GetDataHomeMemberData:(int)numberOfHomes {
    
    FIRFirestore *defaultFirestore = [FIRFirestore firestore];
    
    [[[[defaultFirestore collectionWithPath:@"Homes"] queryLimitedToLast:numberOfHomes] queryOrderedByField:@"HomeID"] getDocumentsWithCompletion:^(FIRQuerySnapshot * _Nullable snapshot, NSError * _Nullable error) {
        
        int numberOfHomeMembers = 0;
        NSMutableDictionary *numberOfHomesWithAtLeastOneUnclaimedUninvitedUser = [NSMutableDictionary dictionary];
        int numberOfUnclaimedUsersWithInvitation = 0;
        int numberOfUnclaimedUsersWithoutInvitation = 0;
        
        for (FIRDocumentSnapshot *doc in snapshot.documents) {
            
            NSString *homeID = doc.data[@"HomeID"];
            NSDictionary *homeMembersUnclaimed = doc.data[@"HomeMembersUnclaimed"];
            NSMutableArray *homeMembers = doc.data[@"HomeMembers"];
            
            for (int i=0 ; i<homeMembers.count ; i++) {
                numberOfHomeMembers+=1;
            }
            
            
            for (NSString *key in homeMembersUnclaimed) {
                
                NSDictionary *dict = homeMembersUnclaimed[key];
                
                if (dict[@"InvitationSent"] && [dict[@"InvitationSent"] isEqualToString:@"No"]) {
                    
                    [numberOfHomesWithAtLeastOneUnclaimedUninvitedUser setObject:@"x" forKey:homeID];
                    numberOfUnclaimedUsersWithoutInvitation+=1;
                    
                    
                } else {
                    numberOfUnclaimedUsersWithInvitation+=1;
                }
                
            }
            
        }
        
        printf("@\"NumberOfHomes:%s\",\n", [[NSString stringWithFormat:@"%d", numberOfHomes] UTF8String]);
        printf("@\"NumberOfHomeMembers:%s\",\n", [[NSString stringWithFormat:@"%d", numberOfHomeMembers] UTF8String]);
        printf("@\"NumberOfHomesWithAtLeastOneUnclaimedUninvitedUser:%s\",\n", [[NSString stringWithFormat:@"%lu", (unsigned long)[[numberOfHomesWithAtLeastOneUnclaimedUninvitedUser allKeys] count]] UTF8String]);
        printf("@\"numberOfUnclaimedUsersWithInvitation:%s\",\n", [[NSString stringWithFormat:@"%d", numberOfUnclaimedUsersWithInvitation] UTF8String]);
        printf("@\"numberOfUnclaimedUsersWithoutInvitation:%s\",\n", [[NSString stringWithFormat:@"%d", numberOfUnclaimedUsersWithoutInvitation] UTF8String]);
        
    }];
    
}

