-(void)GetDataAverageAndMedianTasksForArrayOfMixPanelIDs {
    
    NSArray *arrayOfMixPanelIDs = @[
        
    ];
    
    FIRFirestore *defaultFirestore = [FIRFirestore firestore];
    
    NSMutableArray *objectArr = [NSMutableArray array];
    NSMutableArray *objectArrNo1 = [NSMutableArray array];
    NSMutableArray *objectArrNo2 = [NSMutableArray array];
    
    NSMutableDictionary *dictOfNumberOfTasksPerHome = [NSMutableDictionary dictionary];
    
    NSMutableArray *arrayOfUserIDs = [NSMutableArray array];
    NSMutableDictionary *dictOfHomesToCheck = [NSMutableDictionary dictionary];
    
    for (NSString *mixPanelID in arrayOfMixPanelIDs) {
        
        [[[defaultFirestore collectionWithPath:@"Users"] queryWhereField:@"MixPanelID" isEqualTo:mixPanelID] getDocumentsWithCompletion:^(FIRQuerySnapshot * _Nullable snapshot, NSError * _Nullable error) {
            
            for (FIRDocumentSnapshot *doc in snapshot.documents) {
                
                [arrayOfUserIDs addObject:doc.data[@"UserID"]];
                
            }
            
            if ([[[GeneralObject alloc] init] AddToObjectArrAndCheckIfQueryHasEnded:[arrayOfMixPanelIDs mutableCopy] objectArr:objectArrNo1]) {
                
                
                
                
                for (NSString *userID in arrayOfUserIDs) {
                    
                    [[[defaultFirestore collectionWithPath:@"Homes"] queryWhereField:@"HomeMembers" arrayContains:userID] getDocumentsWithCompletion:^(FIRQuerySnapshot * _Nullable snapshot, NSError * _Nullable error) {
                        
                        for (FIRDocumentSnapshot *doc in snapshot.documents) {
                            
                            [dictOfHomesToCheck setObject:@"" forKey:doc.data[@"HomeID"]];
                            
                        }
                        
                        if ([[[GeneralObject alloc] init] AddToObjectArrAndCheckIfQueryHasEnded:[arrayOfUserIDs mutableCopy] objectArr:objectArrNo2]) {
                            
                            
                            
                            
                            for (NSString *homeID in [dictOfHomesToCheck allKeys]) {
                                
                                [[[[defaultFirestore collectionWithPath:@"Homes"] documentWithPath:homeID] collectionWithPath:@"Chores"] getDocumentsWithCompletion:^(FIRQuerySnapshot * _Nullable snapshot, NSError * _Nullable error) {
                                    
                                    for (FIRDocumentSnapshot *doc in snapshot.documents) {
                                        
                                        NSString *itemHomeID = doc.data[@"ItemHomeID"];
                                        
                                        NSString *amountOfTasksCountedForHome = dictOfNumberOfTasksPerHome[itemHomeID] ? dictOfNumberOfTasksPerHome[itemHomeID] : @"0";
                                        int amountOfTasksCountedForHomePlusOne = [amountOfTasksCountedForHome intValue] + 1;
                                        
                                        [dictOfNumberOfTasksPerHome setObject:[NSString stringWithFormat:@"%d", amountOfTasksCountedForHomePlusOne] forKey:itemHomeID];
                                        
                                    }
                                    
                                    if ([[[GeneralObject alloc] init] AddToObjectArrAndCheckIfQueryHasEnded:[arrayOfUserIDs mutableCopy] objectArr:objectArr]) {
                                        
                                        //                                       for (NSString *homeID in arrayOfMixPanelIDs) {
                                        //                                           if (!dictOfNumberOfTasksPerHome[homeID]) {
                                        //                                               [dictOfNumberOfTasksPerHome setObject:@"0" forKey:homeID];
                                        //                                           }
                                        //                                       }
                                        
                                        NSMutableArray *arrayOfNumberOfTasksPerHome = [NSMutableArray array];
                                        
                                        
                                        for (NSString *homeID in [dictOfNumberOfTasksPerHome allKeys]) {
                                            [arrayOfNumberOfTasksPerHome addObject:[NSNumber numberWithInt:[dictOfNumberOfTasksPerHome[homeID] intValue]]];
                                        }
                                        
                                        NSArray *sortedArray = [arrayOfNumberOfTasksPerHome sortedArrayUsingSelector:@selector(compare:)];    // Sort the array by value
                                        NSUInteger middle = [sortedArray count] / 2;                                           // Find the index of the middle element
                                        NSNumber *median = [sortedArray objectAtIndex:middle];
                                        
                                        float totalNumberOfTasks = 0;
                                        
                                        for (NSString *homeID in [dictOfNumberOfTasksPerHome allKeys]) {
                                            
                                            int amountOfTasksInHome = [dictOfNumberOfTasksPerHome[homeID] intValue];
                                            totalNumberOfTasks += amountOfTasksInHome;
                                            
                                        }
                                        
                                        float average = totalNumberOfTasks / (float)[[dictOfNumberOfTasksPerHome allKeys] count];
                                        
                                        NSLog(@"Users: %lu, Homes: %lu", [arrayOfUserIDs count], [[dictOfNumberOfTasksPerHome allKeys] count]);
                                        NSLog(@"Average Chores Per Home: %.2f\nMedian Chores Per Home: %@", average, median);
                                        
                                    }
                                    
                                }];
                                
                                
                            }
                            
                        }
                        
                    }];
                    
                }
                
            }
            
        }];
        
    }
    
}

