-(void)GetDataSubscriptionsMixPanelIDs {
    
    NSMutableArray *mixPanelIDArray = [NSMutableArray array];
    
    FIRFirestore *defaultFirestore = [FIRFirestore firestore];
    
    [[defaultFirestore collectionWithPath:@"Subscriptions"] getDocumentsWithCompletion:^(FIRQuerySnapshot * _Nullable snapshot, NSError * _Nullable error) {
        
        NSMutableArray *objectArr = [NSMutableArray array];
        
        for (FIRDocumentSnapshot *doc in snapshot.documents) {
            
            NSString *subscriptionPurchasedBy = doc.data[@"SubscriptionPurchasedBy"];
            
            [[[defaultFirestore collectionWithPath:@"Users"] queryWhereField:@"UserID" isEqualTo:subscriptionPurchasedBy] getDocumentsWithCompletion:^(FIRQuerySnapshot * _Nullable snapshotNo1, NSError * _Nullable error) {
                
                for (FIRDocumentSnapshot *doc in snapshotNo1.documents) {
                    
                    NSString *mixPanelID = doc.data[@"MixPanelID"];
                    
                    [mixPanelIDArray addObject:mixPanelID];
                    
                }
                
                if ([[[GeneralObject alloc] init] AddToObjectArrAndCheckIfQueryHasEnded:[snapshot.documents mutableCopy] objectArr:objectArr]) {
                    
                    printf("MixPanelIDArrayEnd - %s\n", [[NSString stringWithFormat:@"%@", mixPanelIDArray] UTF8String]);
                    
                }
                
            }];
            
        }
        
    }];
    
}

