-(void)GetDataSubscriptionPassedFreeTrial:(NSString *)startingWeek endingWeek:(NSString *)endingWeek {
    
    FIRFirestore *defaultFirestore = [FIRFirestore firestore];
    
    [[defaultFirestore collectionWithPath:@"Subscriptions"] getDocumentsWithCompletion:^(FIRQuerySnapshot * _Nullable snapshot, NSError * _Nullable error) {
        
        NSMutableArray *arrayOfSubscriptionsInTimeFrame = [NSMutableArray array];
        
        for (FIRDocumentSnapshot *doc in snapshot.documents) {
            
            NSString *subscriptionID = doc.data[@"SubscriptionID"] ? doc.data[@"SubscriptionID"] : @"";
            NSString *subscriptionDateCancelled = doc.data[@"SubscriptionDateCancelled"] ? doc.data[@"SubscriptionDateCancelled"] : @"";
            NSString *subscriptionDateLastOpenned = doc.data[@"SubscriptionDateLastOpenned"] ? doc.data[@"SubscriptionDateLastOpenned"] : @"xxx";
            NSString *subscriptionDatePurchased = doc.data[@"SubscriptionDatePurchased"] ? doc.data[@"SubscriptionDatePurchased"] : @"";
            
            if ([subscriptionDateLastOpenned isEqualToString:@"xxx"] == NO) {
                
//                NSArray *arr = [subscriptionDatePurchased componentsSeparatedByString:@" "];
                
                NSDateFormatter *dateFormatter = [[[GeneralObject alloc] init] GenerateDateFormatWithString:@"yyyy-MM-dd HH:mm:ss"];
                NSDate *subscriptionPurchasedByDateInDateForm = [dateFormatter dateFromString:subscriptionDatePurchased];
                NSDate *startingWeekInDateForm = [dateFormatter dateFromString:startingWeek];
                NSDate *endingWeekInDateForm = [dateFormatter dateFromString:endingWeek];
                
                if ([subscriptionPurchasedByDateInDateForm timeIntervalSinceDate:startingWeekInDateForm] >= 0 &&
                    [endingWeekInDateForm timeIntervalSinceDate:subscriptionPurchasedByDateInDateForm] >= 0) {
                    
                    [arrayOfSubscriptionsInTimeFrame addObject:@{@"SubscriptionDatePurchased" : subscriptionDatePurchased, @"SubscriptionDateLastOpenned" : subscriptionDateLastOpenned, @"SubscriptionDateCancelled" : subscriptionDateCancelled, @"SubscriptionID" : subscriptionID}];
                    
                }
                
            }
            
        }
        
        NSDateFormatter *dateFormatter = [[[GeneralObject alloc] init] GenerateDateFormatWithString:@"yyyy-MM-dd HH:mm:ss"];
       
        NSMutableArray *arrayOfPassedSubscriptions = [NSMutableArray array];
        
        for (NSDictionary *dict in arrayOfSubscriptionsInTimeFrame) {
            
            if ([dict[@"SubscriptionDateLastOpenned"] length] > 0) {
                
                NSString *lastDateToCheck = dict[@"SubscriptionDateLastOpenned"];
                
                if ([dict[@"SubscriptionDateCancelled"] length] > 0) {
                    
//                    NSString *lastDateToCheck = dict[@"SubscriptionDateCancelled"];
                    
                }
              
                NSDate *lastDateToCheckInDateForm = [dateFormatter dateFromString:lastDateToCheck];
                NSDate *datePurchased = [dateFormatter dateFromString:dict[@"SubscriptionDatePurchased"]];
                
                if ([lastDateToCheckInDateForm timeIntervalSinceDate:datePurchased] > 86400*7) {
                   
                    [arrayOfPassedSubscriptions addObject:dict[@"SubscriptionID"]];
                    
                }
                
            }
            
        }
        NSLog(@"SubscriptionPassedFreeTrialEnd - \nNumofSubs:%lu \nNumofPassed:%lu \nPercentagePassed:%.2f \nArrayOfPassed:%@", arrayOfSubscriptionsInTimeFrame.count, (unsigned long)arrayOfPassedSubscriptions.count, ((float)arrayOfPassedSubscriptions.count / (float)arrayOfSubscriptionsInTimeFrame.count) * 100, arrayOfPassedSubscriptions);
    }];
    
}
     
-(void)GetDataSubscriptionUsersBetweensStartingWeek:(NSString *)startingWeek endingWeek:(NSString *)endingWeek {
    
    FIRFirestore *defaultFirestore = [FIRFirestore firestore];
    
    [[defaultFirestore collectionWithPath:@"Subscriptions"] getDocumentsWithCompletion:^(FIRQuerySnapshot * _Nullable snapshot, NSError * _Nullable error) {
        
        NSMutableArray *arrayOfUsers = [NSMutableArray array];
        
        for (FIRDocumentSnapshot *doc in snapshot.documents) {
            
            NSString *subsriptionPurchasedBy = doc.data[@"SubscriptionPurchasedBy"];
            
            NSArray *arr = [subsriptionPurchasedBy componentsSeparatedByString:@" "];
            
            NSString *subscriptionPurchasedByDate = arr[0];
            
            NSDateFormatter *dateFormatter = [[[GeneralObject alloc] init] GenerateDateFormatWithString:@"yyyy-MM-dd"];
            NSDate *subscriptionPurchasedByDateInDateForm = [dateFormatter dateFromString:subscriptionPurchasedByDate];
            NSDate *startingWeekInDateForm = [dateFormatter dateFromString:startingWeek];
            NSDate *endingWeekInDateForm = [dateFormatter dateFromString:endingWeek];
         
            if ([subscriptionPurchasedByDateInDateForm timeIntervalSinceDate:startingWeekInDateForm] >= 0 &&
                [endingWeekInDateForm timeIntervalSinceDate:subscriptionPurchasedByDateInDateForm] >= 0) {
                
                [arrayOfUsers addObject:subsriptionPurchasedBy];
                
            }
            
        }
        
        NSMutableArray *arrayOfUsersNo1 = [NSMutableArray array];
        
        for (NSString *userID in arrayOfUsers) {
          
            [[[defaultFirestore collectionWithPath:@"Users"] queryWhereField:@"UserID" isEqualTo:userID] getDocumentsWithCompletion:^(FIRQuerySnapshot * _Nullable snapshot, NSError * _Nullable error) {
                
                for (FIRDocumentSnapshot *doc in snapshot.documents) {
                    
                    NSString *mixPanelID = doc.data[@"MixPanelID"];
                    [arrayOfUsersNo1 addObject:mixPanelID];
                    
                }
                
                if ([[arrayOfUsers lastObject] isEqualToString:userID]) {
                    NSLog(@"SubscriptionUsersEnd - %@", arrayOfUsersNo1);
                }
                
            }];
            
        }
        
    }];
    
}

