-(void)SetDataHomesOfCrashedUsersForAppVersion:(NSString *)appVersion arrayOfHomeIDs:(NSArray *)arrayOfHomeIDs {
   
    [self GetDataUserIDOfCrahesOnAppVersion:appVersion completionHandler:^(BOOL finished, NSString * _Nonnull userID) {
       
        [self GetDataHomeIDOfUserID:userID completionHandler:^(BOOL finished, NSString * _Nonnull itemHomeID) {
           
            BOOL HomeIDIsValid = [arrayOfHomeIDs count] == 0 || ([arrayOfHomeIDs count] > 0 && [arrayOfHomeIDs containsObject:itemHomeID]);
            
            if (HomeIDIsValid) {
              
                self->progressView = [MRProgressOverlayView showOverlayAddedTo:self.navigationController.view animated:YES];
                self->progressView.mode = MRProgressOverlayViewModeIndeterminateSmall;
                
                [self SetDataCopyHomeWithID:itemHomeID completionHandler:^(BOOL finished) {
                  
                    [self->progressView setHidden:YES];
                    
                }];
                
            }
            
        }];
        
    }];
    
