                                }];
                                
                            }
                            
                            if (!doc.data[@"ItemUniqueID"]) {
                                
                                [[[[[defaultFirestore collectionWithPath:@"Homes"] documentWithPath:homeID] collectionWithPath:collection] documentWithPath:doc.data[@"ItemID"]] setData:@{@"ItemUniqueID" : [[[GeneralObject alloc] init] GenerateRandomESTNumberIntoString]} merge:YES completion:^(NSError * _Nullable error) {
                                    
                                }];
                                
                            }
                            
                            if (doc.data[@"ItemRepeats"] && [doc.data[@"ItemRepeats"] isEqualToString:@"When Completed"]) {
                                
                                [[[[[defaultFirestore collectionWithPath:@"Homes"] documentWithPath:homeID] collectionWithPath:collection] documentWithPath:doc.data[@"ItemID"]] setData:@{@"ItemRepeats" : @"Never"} merge:YES completion:^(NSError * _Nullable error) {
                                    
                                }];
                                
                                [[[[[defaultFirestore collectionWithPath:@"Homes"] documentWithPath:homeID] collectionWithPath:collection] documentWithPath:doc.data[@"ItemID"]] setData:@{@"ItemRepeatIfCompletedEarly" : @"Yes"} merge:YES completion:^(NSError * _Nullable error) {
                                    
                                }];
                                
                            } else if (!doc.data[@"ItemRepeatIfCompletedEarly"]) {
                                
                                [[[[[defaultFirestore collectionWithPath:@"Homes"] documentWithPath:homeID] collectionWithPath:collection] documentWithPath:doc.data[@"ItemID"]] setData:@{@"ItemRepeatIfCompletedEarly" : @"No"} merge:YES completion:^(NSError * _Nullable error) {
                                    
