            for (FIRDocumentSnapshot *doc in snapshot.documents) {
                
                [userAnalyticsArray addObject:doc.data];
                
            }
            
            if ([[[GeneralObject alloc] init] AddToObjectArrAndCheckIfQueryHasEnded:[mixPanelIDArray mutableCopy] objectArr:objectArr]) {
                
                [self Retention:mixPanelIDArray weekDict:dictOfCohortWeeks cohortWeek:cohortWeek GettingEmails:GettingEmails userAnalyticsArray:userAnalyticsArray];
                
                finishBlock(YES);
                
            }
            
        }];
        
    }
    
}

-(void)Retention:(NSArray *)mixPanelIDArray weekDict:(NSDictionary *)weekDict cohortWeek:(NSString *)cohortWeek GettingEmails:(BOOL)GettingEmails userAnalyticsArray:(NSMutableArray *)userAnalyticsArray {
    
    NSMutableDictionary *dictOfRetentionAmountsPerTimeFrame = [NSMutableDictionary dictionary];
    __block int AmountOfUsersRetainedInTimeFrame = 0;
    
    NSDateFormatter *dateFormatter = [[NSDateFormatter alloc] init];
    [dateFormatter setLocale:[NSLocale currentLocale]];
    
    NSDate *startingDate;
    NSDate *endingDate;
    
    //Loop through each time frame
    for (NSString *startingDateString in [weekDict allKeys]) {
        
        NSString *endingDateString = weekDict[startingDateString];
        
        [dateFormatter setDateFormat:@"MMMM dd, yyyy hh:mm:ss a"];
        startingDate = [dateFormatter dateFromString:startingDateString];
        endingDate = [dateFormatter dateFromString:endingDateString];
        
        
        
        
        //Loop through each users analytics
        for (NSDictionary *specificUsersSessions in userAnalyticsArray) {
            
            NSArray *specificUsersSessionKeys = [specificUsersSessions allKeys];
            
            
            
            
            //Loop through specific users sessions
            for (NSString *sessionKey in specificUsersSessionKeys) {
                
                if (![sessionKey isEqualToString:@"MixPanelID"]) {
                    
                    [dateFormatter setDateFormat:@"MMMM dd, yyyy hh:mm:ss a"];
                    
                    NSDate *sessionKeyInDateForm = [dateFormatter dateFromString:sessionKey];
                    
                    BOOL SessionIsWithinTheTimeFrame = [self date:sessionKeyInDateForm isBetweenDate:startingDate andDate:endingDate] && sessionKeyInDateForm != nil;
                    
                    
                    
                    
                    //Found session within time frame
                    if (SessionIsWithinTheTimeFrame == YES) {
                        
                        BOOL CountRetention = false;
                        
                        int totalValidViewControllers = 0;
                        NSArray *invalidViewControllers = @[@"CustomAdd", @"didFinishLaunchingWithOptions", @"applicationDidBecomeActive", @"applicationWillResignActive", @"applicationWillEnterForeground", @"applicationDidEnterBackground", @"willConnectToSession", @"sceneDidBecomeActive", @"sceneWillResignActive", @"sceneWillEnterForeground", @"sceneDidEnterBackground"];
                        
                        
                        
                        
                        NSDictionary *specificSession = specificUsersSessions[sessionKey];
                        NSArray *specificSessionPageOpennedKeys = [specificSession allKeys];
                        
                        //Loop through specific page opennings in specific session
                        for (NSString *specificPageOpennedKey in specificSessionPageOpennedKeys) {
                            
                            NSDictionary *specificPageOpennedDict = specificSession[specificPageOpennedKey];
                            
                            NSString *viewController = specificPageOpennedDict[@"ViewController"];
                            NSMutableArray *touchEvents = specificPageOpennedDict[@"TouchEvents"];
                            
                            if ([invalidViewControllers containsObject:viewController] == NO) {
                                totalValidViewControllers += 1;
                            }
                            
                            //More than one valid view controller
                            if (totalValidViewControllers > 1) {
                                
                                CountRetention = true;
                                break;
                                
                            }
                            
                            //More than zero touch events in valid view controller
                            if ([invalidViewControllers containsObject:viewController] == NO && [touchEvents count] > 0) {
                                
                                CountRetention = true;
                                break;
                                
                            }
                            
                            //Custom add
                            if ([viewController isEqualToString:@"CustomAdd"] == YES) {
                                
                                CountRetention = true;
                                break;
                                
                            }
                            
                        }
                        
                        //If found retention add user
                        if (CountRetention == true) {
                            
                            NSString *mixPanelID = specificUsersSessions[@"MixPanelID"];
                            
                            NSMutableArray *arrayOfRetainedMixPanelIDs =
                            [[NSUserDefaults standardUserDefaults] objectForKey:@"UsersRetainedInAllTimeFrames"] ?
                            [[[NSUserDefaults standardUserDefaults] objectForKey:@"UsersRetainedInAllTimeFrames"] mutableCopy] : [NSMutableArray array];
                            
                            [arrayOfRetainedMixPanelIDs addObject:[NSString stringWithFormat:@"@\"%@\",", mixPanelID]];
                            [[NSUserDefaults standardUserDefaults] setObject:arrayOfRetainedMixPanelIDs forKey:@"UsersRetainedInAllTimeFrames"];
                            
                            AmountOfUsersRetainedInTimeFrame += 1;
                            break;
                            
                        }
                        
                    }
                    
                }
                
            }
            
        }
        
        //Save amount of users found for specific time frame
        [dictOfRetentionAmountsPerTimeFrame setObject:[NSString stringWithFormat:@"%d -- %.2f%%", AmountOfUsersRetainedInTimeFrame, ((float)((float)AmountOfUsersRetainedInTimeFrame/(float)mixPanelIDArray.count))*100] forKey:[NSString stringWithFormat:@"%@ - %@", startingDateString, endingDateString]];
        AmountOfUsersRetainedInTimeFrame = 0;
        
    }
    
    //Print result
    NSLog(@"RetentionEnd - (%@)\n%@", cohortWeek, dictOfRetentionAmountsPerTimeFrame);
    NSMutableDictionary *megaDict = [[[NSUserDefaults standardUserDefaults] objectForKey:@"MegaDict"] mutableCopy];
    
    [megaDict setObject:dictOfRetentionAmountsPerTimeFrame forKey:cohortWeek];
    [[NSUserDefaults standardUserDefaults] setObject:megaDict forKey:@"MegaDict"];
    
}

