-(NSMutableDictionary *)GenerateDictOfDatesToCheckForUsers:(NSArray *)yearArr monthArr:(NSArray *)monthArr daysDictArr:(NSDictionary *)daysDictArr arrayOfMixPanelIDsToCheck:(NSMutableArray *)arrayOfMixPanelIDsToCheck {
    
    NSMutableDictionary *dictOfDatesToCheckForUsers = [NSMutableDictionary dictionary];
    
    for (NSString *year in yearArr) {
        
        for (NSString *month in monthArr) {
            
            for (int i=1;i<=[daysDictArr[month] intValue];i++) {
                
                NSString *key = [NSString stringWithFormat:@"%@ %02d, %@ 12:00:00 AM", month, i, year];
                NSString *value = [NSString stringWithFormat:@"%@ %02d, %@ 11:59:59 PM", month, i, year];
                
                NSDateFormatter *format = [[NSDateFormatter alloc] init];
                [format setDateFormat:@"MMMM dd, yyyy hh:mm:ss a"];
                NSDate *startingDate = [format dateFromString:key];
                [format setDateFormat:@"yyyy-MM-dd"];
                NSString* startingDateConverted = [format stringFromDate:startingDate];
                [format setDateFormat:@"yyyy-MM-dd"];
                NSDate *startingDateDate = [format dateFromString:startingDateConverted];
                
                NSString *currentDate = [[[GeneralObject alloc] init] GenerateCurrentDateWithFormat:@"yyyy-MM-dd" returnAs:[NSString class]];
                NSDate *currentDateDate = [format dateFromString:currentDate];
                
                
                NSString *mixPanelWithExtraOff = @"";
                NSString *userID = [arrayOfMixPanelIDsToCheck count] > 0 ? arrayOfMixPanelIDsToCheck[0] : @"";
                
                for (int i=0;i<10;i++) {
                    mixPanelWithExtraOff = [NSString stringWithFormat:@"%@%c", mixPanelWithExtraOff, [userID length] > i ? [userID characterAtIndex:i] : 'x'];
                }
                
                
                
                NSDate *mixPanelDateDate = [format dateFromString:mixPanelWithExtraOff];
                
                if (([self date:startingDateDate isBefore:mixPanelDateDate andDate:mixPanelDateDate] == NO || [startingDateDate timeIntervalSinceDate:mixPanelDateDate] == 0) && [self date:currentDateDate isBefore:startingDateDate andDate:startingDateDate] == NO) {
                    
                    [dictOfDatesToCheckForUsers setValue:value forKey:key];
                    
                }
                
            }
            
        }
        
    }
    
    return dictOfDatesToCheckForUsers;
}

-(NSMutableDictionary *)GenerateDictOfUniqueMixPanelDates:(NSArray *)arrayOfAllMixPanelIDs {
    
    NSMutableDictionary *dictOfUniqueMixPanelIDDates = [NSMutableDictionary dictionary];
    
    for (NSString *mixPanelID in arrayOfAllMixPanelIDs) {
        
        NSString *mixPanelIDTemp = [mixPanelID mutableCopy];
        mixPanelIDTemp = [mixPanelIDTemp componentsSeparatedByString:@" "][0];
        [dictOfUniqueMixPanelIDDates setObject:@"" forKey:mixPanelIDTemp];
        
    }
    
    return dictOfUniqueMixPanelIDDates;
}

-(NSMutableArray *)GenerateArrayOfMixPanelIDsCreatedOnSpecificDate:(NSArray *)arrayOfAllMixPanelIDs startingDateString:(NSString *)startingDateString {
    
    NSMutableArray *arrayOfMixPanelIDsToCheck = [NSMutableArray array];
    
    for (NSString *mixPanelID in arrayOfAllMixPanelIDs) {
        
        NSDateFormatter *format = [[NSDateFormatter alloc] init];
        [format setDateFormat:@"MMMM dd, yyyy hh:mm:ss a"];
        NSDate *startingDate = [format dateFromString:startingDateString];
        [format setDateFormat:@"yyyy-MM-dd HH:mm:ss"];
        NSString* startingDateConverted = [format stringFromDate:startingDate];
        
        NSString *mixPanelDate = [mixPanelID componentsSeparatedByString:@" "][0];
        
        BOOL MixPanelIDCreatedOnDateWeAreChecking = [startingDateConverted containsString:mixPanelDate];
        
        if (MixPanelIDCreatedOnDateWeAreChecking == YES) {
            [arrayOfMixPanelIDsToCheck addObject:mixPanelID];
        }
        
    }
    
    return arrayOfMixPanelIDsToCheck;
}

-(void)GenerateDayAverages:(NSMutableDictionary *)dictOfUniqueMixPanelIDDates {
    
    if ([[NSUserDefaults standardUserDefaults] objectForKey:@"MegaDict"] && [[[[NSUserDefaults standardUserDefaults] objectForKey:@"MegaDict"] allKeys] count] == [[dictOfUniqueMixPanelIDDates allKeys] count]) {
        
        NSMutableDictionary *megaDictNo2 = [NSMutableDictionary dictionary];
        
        NSLog(@"MegaDict %@", [[NSUserDefaults standardUserDefaults] objectForKey:@"MegaDict"]);
        NSMutableDictionary *megaDict = [[NSUserDefaults standardUserDefaults] objectForKey:@"MegaDict"];
        
        for (NSString *megaDictKey in [megaDict allKeys]) {
            
            NSDictionary *dict = megaDict[megaDictKey];
            NSString *userAmount = [megaDictKey componentsSeparatedByString:@" - "][0];
            
            userAmount = [[[GeneralObject alloc] init] GenerateStringWithRemovedSymbols:userAmount arrayOfSymbols:@[@"Users "]];
            
            for (NSString *dictKey in [dict allKeys]) {
                
                NSUInteger index = [[dict allKeys] indexOfObject:dictKey];
                
//               NSString *startEndDate = [dictKey mutableCopy];
                NSString *amountForStartEndDate = dict[dictKey];
                
                NSMutableArray *previousArr = [megaDictNo2 objectForKey:[NSString stringWithFormat:@"Day %lu", index]] ? [[megaDictNo2 objectForKey:[NSString stringWithFormat:@"Day %lu", index]] mutableCopy] : [NSMutableArray array];
                float calculation = [amountForStartEndDate floatValue] / [userAmount floatValue];
                
                [previousArr addObject:[NSString stringWithFormat:@"User Amount - %@, Amount Found - %@, Calculation - %f", userAmount, amountForStartEndDate, calculation]];
                
                [megaDictNo2 setObject:previousArr forKey:[NSString stringWithFormat:@"Day %lu", index]];
                
            }
            
        }
        
        NSLog(@"MegaDictNo2 %@", megaDictNo2);
        NSMutableDictionary *megaDictNo3 = [NSMutableDictionary dictionary];
        
        for (NSString *megaDictNo2Key in [megaDictNo2 allKeys]) {
            
            NSMutableArray *arr = megaDictNo2[megaDictNo2Key];
            
            float total = 0;
            float totalUsers = 0;
            float finalTotal = 0;
            
            for (NSString *string in arr) {
                
                NSString *userAmountString = [string componentsSeparatedByString:@", Amount Found - "][0];
                userAmountString = [[[GeneralObject alloc] init] GenerateStringWithRemovedSymbols:userAmountString arrayOfSymbols:@[@"User Amount - "]];
                
                NSString *calculationStrin = [string componentsSeparatedByString:@"Calculation - "][1];
                
                total += ([userAmountString floatValue] * [calculationStrin floatValue]);
                totalUsers += [userAmountString floatValue];
            }
            
            finalTotal = (total / totalUsers)*100;
            
            [megaDictNo3 setObject:[NSString stringWithFormat:@"Average - %.2f", finalTotal] forKey:megaDictNo2Key];
            
        }
        NSLog(@"MegaDictNo3 %@", megaDictNo3);
        
        for (int i=0;i<91;i++) {
            
            NSString *data = megaDictNo3[[NSString stringWithFormat:@"Day %d", i]] ? megaDictNo3[[NSString stringWithFormat:@"Day %d", i]] : @"";
            if ([data length] > 0) {
                
                printf("%s\n", [[[NSString stringWithFormat:@"Day %d %@%%", i, data] componentsSeparatedByString:@"Average - "][1] UTF8String]);
                
                
            }
            
        }
        
    }
    
}


