    NSDateComponents *dateComponents = [NSDateComponents new];
    NSDate *currentDate = startingDate;
    
    NSDateFormatter *dateFormatter = [[[GeneralObject alloc] init] GenerateDateFormatWithString:@"yyyy-MM-dd "];
    
    while ([currentDate compare:endingDate] == NSOrderedAscending || [currentDate compare:endingDate] == NSOrderedSame) {
        NSString *formattedDate = [dateFormatter stringFromDate:currentDate];
        [daysArray addObject:formattedDate];
        
        dateComponents.day = 1;
        currentDate = [calendar dateByAddingComponents:dateComponents toDate:currentDate options:0];
    }
    
    return [daysArray copy];
}

-(void)ActiveUsers:(NSDictionary *)weekDict frequency:(NSString *)frequency userAnalyticsArray:(NSMutableArray *)userAnalyticsArray CheckingRetentionUsers:(BOOL)CheckingRetentionUsers completionHandler:(void (^)(BOOL finished))finishBlock {
    
    NSMutableDictionary *dictOfRetentionAmountsPerTimeFrame = [NSMutableDictionary dictionary];
    __block int AmountOfUsersRetainedInTimeFrame = 0;
    NSMutableDictionary *checkingRetentionDict = [@{@"Valid" : [NSMutableArray array], @"Invalid" : [NSMutableArray array]} mutableCopy];
    NSDateFormatter *dateFormatter = [[NSDateFormatter alloc] init];
    [dateFormatter setLocale:[NSLocale currentLocale]];
    
    NSDate *startingDate;
    NSDate *endingDate;
    
    //Loop through each time frame
    for (NSString *startingDateString in [weekDict allKeys]) {
        
        NSString *endingDateString = weekDict[startingDateString];
        
        [dateFormatter setDateFormat:@"MMMM dd, yyyy hh:mm:ss a"];
        startingDate = [dateFormatter dateFromString:startingDateString];
        endingDate = [dateFormatter dateFromString:endingDateString];
        
        NSArray *daysArray = [self DaysBetweenDates:startingDate endingDate:endingDate];

        
        
        
        
        //Loop through each users analytics
        for (NSDictionary *specificUsersSessions in userAnalyticsArray) {
            
            NSArray *specificUsersSessionKeys = [specificUsersSessions allKeys];
            NSString *mixPanelID = specificUsersSessions[@"MixPanelID"];
            
            BOOL MixPanelIDIsInTimeFrame = NO;
            
            for (NSString *day in daysArray) {
                if ([mixPanelID containsString:day]){
                    MixPanelIDIsInTimeFrame = YES;
                    break;
                }
            }
            
            
            
            
            //Loop through specific users sessions
            for (NSString *sessionKey in specificUsersSessionKeys) {
                
                if (![sessionKey isEqualToString:@"MixPanelID"]) {
                    
                    [dateFormatter setDateFormat:@"MMMM dd, yyyy hh:mm:ss a"];
                    
                    NSDate *sessionKeyInDateForm = [dateFormatter dateFromString:sessionKey];
                    
                    BOOL SessionIsWithinTheTimeFrame = [self date:sessionKeyInDateForm isBetweenDate:startingDate andDate:endingDate] && sessionKeyInDateForm != nil;
                    
                    
                    
                    
                    //Found session within time frame
                    if ((CheckingRetentionUsers == NO && SessionIsWithinTheTimeFrame == YES) ||
                        (CheckingRetentionUsers == YES && MixPanelIDIsInTimeFrame == YES)) {
                        
                        BOOL CountRetention = false;
                        
                        int totalValidViewControllers = 0;
                        
                        NSArray *invalidViewControllers = @[
                            //InitialViewControllers
                            @"InitialViewController", @"InitialViewViewController", @"SignUpViewController", @"LoginViewController",
                            
                            //HomeViewControllers
                            @"CreateHomeViewController", @"InviteMembersViewController", @"EnableNotificationsViewController", @"HomeFeaturesViewController", @"HomeOptionsViewController",@"HomesViewController",
                            
                            //Popup
                            @"WeDivvyPremiumViewController",
                            
                            //System
                            @"CustomAdd", @"didFinishLaunchingWithOptions", @"applicationDidBecomeActive", @"applicationWillResignActive", @"applicationWillEnterForeground", @"applicationDidEnterBackground", @"willConnectToSession", @"sceneDidBecomeActive", @"sceneWillResignActive", @"sceneWillEnterForeground", @"sceneDidEnterBackground"];
                        
                        NSDictionary *specificSession = specificUsersSessions[sessionKey];
                        NSArray *specificSessionPageOpennedKeys = [specificSession allKeys];
                        
                        //Loop through specific page opennings in specific session
                        for (NSString *specificPageOpennedKey in specificSessionPageOpennedKeys) {
                            
                            NSDictionary *specificPageOpennedDict = specificSession[specificPageOpennedKey];
                         
                            NSString *appVersion = specificPageOpennedDict[@"AppVersion"];
                            NSString *viewController = specificPageOpennedDict[@"ViewController"];
                            NSMutableArray *touchEvents = specificPageOpennedDict[@"TouchEvents"];
                            
                            if ([invalidViewControllers containsObject:viewController] == NO) {
                                totalValidViewControllers += 1;
                            }
                            
                            //More than one valid view controller
                            if (totalValidViewControllers > 1) {
                                if ([appVersion containsString:@"6.4.9"] == NO) {
                                    NSLog(@"Users On Older Database Version: %@", appVersion);
                                }
                                CountRetention = true;
                                break;
                                
                            }
                            
                            //More than zero touch events in valid view controller
                            if ([invalidViewControllers containsObject:viewController] == NO && [touchEvents count] > 0) {
                                if ([appVersion containsString:@"6.4.9"] == NO) {
                                    NSLog(@"Users On Older Database Version: %@", appVersion);
                                }
                                CountRetention = true;
                                break;
                                
                            }
                            
                            //Custom add
                            if ([viewController isEqualToString:@"CustomAdd"] == YES) {
                                if ([appVersion containsString:@"6.4.9"] == NO) {
                                    NSLog(@"Users On Older Database Version: %@", appVersion);
                                }
                                CountRetention = true;
                                break;
                                
                            }
                            
                        }
                        
                        //If found retention add user
                        if (CountRetention == true) {
                        
                            AmountOfUsersRetainedInTimeFrame += 1;
                            NSMutableDictionary *tempDict = [checkingRetentionDict mutableCopy];
                            NSMutableArray *arr = [tempDict[@"Valid"] mutableCopy];
                            if ([arr containsObject:[NSString stringWithFormat:@"%@", mixPanelID]] == NO) {
                                [arr addObject:[NSString stringWithFormat:@"%@", mixPanelID]];
                            }
                            [tempDict setObject:arr forKey:@"Valid"];
                            checkingRetentionDict = [tempDict mutableCopy];
                            break;
                            
                        }
                        
                    }
                    
                }
                
            }
            
            if ((CheckingRetentionUsers == YES && MixPanelIDIsInTimeFrame == YES) &&
                ([checkingRetentionDict[@"Valid"] containsObject:mixPanelID] == NO)) {
              
                NSMutableDictionary *tempDict = [checkingRetentionDict mutableCopy];
                NSMutableArray *arr = [tempDict[@"Invalid"] mutableCopy];
                if ([arr containsObject:[NSString stringWithFormat:@"%@", mixPanelID]] == NO) {
                    [arr addObject:[NSString stringWithFormat:@"%@", mixPanelID]];
                }
                [tempDict setObject:arr forKey:@"Invalid"];
                checkingRetentionDict = [tempDict mutableCopy];
               
            }
            
        }
        
        //Save amount of users found for specific time frame
        [dictOfRetentionAmountsPerTimeFrame setObject:[NSString stringWithFormat:@"%d", AmountOfUsersRetainedInTimeFrame] forKey:[NSString stringWithFormat:@"%@ - %@", startingDateString, endingDateString]];
        AmountOfUsersRetainedInTimeFrame = 0;
        
    }
    
    //Print result
    NSLog(@"ActiveEnd - (%@)\n%@", frequency, dictOfRetentionAmountsPerTimeFrame);
    NSLog(@"Valid");
    for (NSString *valid in checkingRetentionDict[@"Valid"]) {
        NSString *message = [NSString stringWithFormat:@"@\"%@\",", valid];
        printf("%s\n", [message UTF8String]);
    }
    NSLog(@"Invalid");
    for (NSString *valid in checkingRetentionDict[@"Invalid"]) {
        NSString *message = [NSString stringWithFormat:@"@\"%@\",//", valid];
        printf("%s\n", [message UTF8String]);
    }
    
}

