-(void)Completion:(NSArray *)mixPanelID weekDict:(NSDictionary *)weekDict cohortWeek:(NSString *)cohortWeek userAnalyticsArray:(NSMutableArray *)userAnalyticsArray {
    
    NSMutableDictionary *dictOfRetentionAmountsPerTimeFrame = [NSMutableDictionary dictionary];
    
    int countCompleted = 0;
    int countUncompleted = 0;
    
    NSDateFormatter *dateFormatter = [[NSDateFormatter alloc] init];
    [dateFormatter setLocale:[NSLocale currentLocale]];
    
    NSDate *startingDate;
    NSDate *endingDate;
    
    for (NSString *startingDateString in [weekDict allKeys]) {
        
        NSString *endingDateString = weekDict[startingDateString];
        
        [dateFormatter setDateFormat:@"MMMM dd, yyyy hh:mm:ss a"];
        startingDate = [dateFormatter dateFromString:startingDateString];
        endingDate = [dateFormatter dateFromString:endingDateString];
        
        
        
        
        //Loop through each users analytics
        for (NSDictionary *specificUsersSessions in userAnalyticsArray) {
            
            NSArray *specificUsersSessionKeys = [specificUsersSessions allKeys];
            
            
            
            
            //Loop through specific users sessions
            for (NSString *sessionKey in specificUsersSessionKeys) {
                
                if (![sessionKey isEqualToString:@"MixPanelID"]) {
                    
                    [dateFormatter setDateFormat:@"MMMM dd, yyyy hh:mm:ss a"];
                    
                    NSDate *sessionKeyInDateForm = [dateFormatter dateFromString:sessionKey];
                    
                    BOOL SessionIsWithinTheTimeFrame = [self date:sessionKeyInDateForm isBetweenDate:startingDate andDate:endingDate] && sessionKeyInDateForm != nil;
                    
                    //Found session within time frame
                    if (SessionIsWithinTheTimeFrame == YES) {
                        
                        NSDictionary *specificSession = specificUsersSessions[sessionKey];
                        //If session contains touch event find the number of times
                        if ([[NSString stringWithFormat:@"%@", specificSession] containsString:@"Complete Clicked"] ||
                            [[NSString stringWithFormat:@"%@", specificSession] containsString:@"Completed Task"] ||
                            [[NSString stringWithFormat:@"%@", specificSession] containsString:@"Complete Task"] ||
                            [[NSString stringWithFormat:@"%@", specificSession] containsString:@"Uncomplete Clicked"] ||
                            [[NSString stringWithFormat:@"%@", specificSession] containsString:@"Uncompleted Task"] ||
                            [[NSString stringWithFormat:@"%@", specificSession] containsString:@"Uncomplete Task"]) {
                            
                            NSString *string = [NSString stringWithFormat:@"%@", specificSession];
                            NSError *error = NULL;
                            NSRegularExpression *regex = [NSRegularExpression regularExpressionWithPattern:@"Completed Task" options:NSRegularExpressionCaseInsensitive error:&error];
                            NSUInteger numberOfMatches = [regex numberOfMatchesInString:string options:0 range:NSMakeRange(0, [string length])];
                            NSRegularExpression *regex123 = [NSRegularExpression regularExpressionWithPattern:@"Complete Task" options:NSRegularExpressionCaseInsensitive error:&error];
                            NSUInteger numberOfMatches123 = [regex123 numberOfMatchesInString:string options:0 range:NSMakeRange(0, [string length])];
                            NSRegularExpression *regex456 = [NSRegularExpression regularExpressionWithPattern:@"Complete Clicked" options:NSRegularExpressionCaseInsensitive error:&error];
                            NSUInteger numberOfMatches456 = [regex456 numberOfMatchesInString:string options:0 range:NSMakeRange(0, [string length])];
                            NSRegularExpression *regex4 = [NSRegularExpression regularExpressionWithPattern:@"Uncompleted Task" options:NSRegularExpressionCaseInsensitive error:&error];
                            NSUInteger numberOfMatches4 = [regex4 numberOfMatchesInString:string options:0 range:NSMakeRange(0, [string length])];
                            NSRegularExpression *regex5 = [NSRegularExpression regularExpressionWithPattern:@"Uncomplete Task" options:NSRegularExpressionCaseInsensitive error:&error];
                            NSUInteger numberOfMatches5 = [regex5 numberOfMatchesInString:string options:0 range:NSMakeRange(0, [string length])];
                            NSRegularExpression *regex6 = [NSRegularExpression regularExpressionWithPattern:@"Uncomplete Clicked" options:NSRegularExpressionCaseInsensitive error:&error];
                            NSUInteger numberOfMatches6 = [regex6 numberOfMatchesInString:string options:0 range:NSMakeRange(0, [string length])];
                            
                            countCompleted += numberOfMatches;
                            countCompleted += numberOfMatches123;
                            countCompleted += numberOfMatches456;
                            countUncompleted -= numberOfMatches4;
                            countUncompleted -= numberOfMatches5;
                            countUncompleted -= numberOfMatches6;
                            
                            break;
                            
                        }
                        
                    }
                    
                }
                
            }
            
            
        }
        
        //Save amount of users found for specific time frame
        [dictOfRetentionAmountsPerTimeFrame setObject:[NSString stringWithFormat:@"Completed - %d -- Uncompleted - %d", countCompleted, -1*countUncompleted] forKey:[NSString stringWithFormat:@"%@ - %@", startingDateString, endingDateString]];
        
        countCompleted = 0;
        countUncompleted = 0;
        
    }
    
    //Print result
    NSLog(@"CompletionEnd - (%@)\n%@", cohortWeek, dictOfRetentionAmountsPerTimeFrame);
}

