                                    if (ViewingWeDivvyPremiumAfterSignUp) {
                                        
                                        //Doesn't count, skip to next occurrence of WeDivvyPremium in the same session
                                        break;
                                        
                                    } else if ([previousViewController isEqualToString:@"WeDivvyPremiumViewController"] == NO &&
                                               [invalidViewControllers containsObject:previousViewController] == NO) {
                                        
                                        //Save view controller before WeDivvyPremiumViewController
                                        CountRetention = true;
                                        
                                        //Save amount of users found for specific time frame
                                        NSString *key = [NSString stringWithFormat:@"%@ -- %@", previousViewController, previousTouchEvents];
                                        
                                        int count = dictOfRetentionAmountsPerTimeFrame[key] ? [dictOfRetentionAmountsPerTimeFrame[key] intValue] + 1 : 1;
                                        [dictOfRetentionAmountsPerTimeFrame setObject:[NSString stringWithFormat:@"%d", count] forKey:key];
                                        
                                        break;
                                        
                                    }
                                    
                                }
                                
                            }
                            
                        }
                        
                    }
                    
                }
                
            }
            
        }
        
    }
    
    //Print result
    NSLog(@"WeDivvyPremiumOpenEnd - (%@)\n%@", cohortWeek, dictOfRetentionAmountsPerTimeFrame);
    
}

