-(void)Crashes:(NSArray *)mixPanelID weekDict:(NSDictionary *)weekDict cohortWeek:(NSString *)cohortWeek crashesArray:(NSMutableDictionary *)crashesArray {
    
    NSMutableDictionary *dictOfRetentionAmountsPerTimeFrame = [NSMutableDictionary dictionary];
    NSMutableDictionary *AmountOfUsersRetainedInTimeFrame = [NSMutableDictionary dictionary];
    
    NSDateFormatter *dateFormatter = [[NSDateFormatter alloc] init];
    [dateFormatter setLocale:[NSLocale currentLocale]];
    
