    NSMutableDictionary *weekDictToUse = allDict[arrayOfUsers];
    
    [[defaultFirestore collectionWithPath:@"Subscriptions"] getDocumentsWithCompletion:^(FIRQuerySnapshot * _Nullable snapshot, NSError * _Nullable error) {
        
        for (FIRDocumentSnapshot *doc in snapshot.documents) {
            
            [userAnalyticsArray addObject:doc.data];
            
        }
        
        [self SubscriptionFreeTrialChurn:arrayOfUsers weekDict:weekDictToUse cohortWeek:cohortWeek endingPeriodWeek:endingPeriodWeek userAnalyticsArray:userAnalyticsArray];
        
        finishBlock(YES);
        
    }];
    
