-(void)SubscriptionChurn:(NSArray *)mixPanelID weekDict:(NSDictionary *)weekDict cohortWeek:(NSString *)cohortWeek endingPeriodWeek:(NSString *)endingPeriodWeek userAnalyticsArray:(NSMutableArray *)userAnalyticsArray {
    
    NSMutableDictionary *dictOfRetentionAmountsPerTimeFrame = [NSMutableDictionary dictionary];
    __block int AmountOfUsersRetainedInTimeFrame = 0;
    __block double TotalPriceOfCountedSubscriptions = 0.00;
    
    NSDateFormatter *dateFormatter = [[NSDateFormatter alloc] init];
    [dateFormatter setLocale:[NSLocale currentLocale]];
    
    NSDate *startingDate;
    NSDate *endingDate;
    
    //Loop through each time frame
    for (NSString *startingDateString in [weekDict allKeys]) {
        
        NSString *endingDateString = weekDict[startingDateString];
        
        startingDate = [[[GeneralObject alloc] init] GenerateDateWithConvertedClassWithFormat:@"MMMM dd, yyyy hh:mm:ss a" dateToConvert:startingDateString returnAs:[NSDate class]];
        endingDate = [[[GeneralObject alloc] init] GenerateDateWithConvertedClassWithFormat:@"MMMM dd, yyyy hh:mm:ss a" dateToConvert:endingDateString returnAs:[NSDate class]];
        
        
        
        
        for (NSDictionary *subscriptionDict in userAnalyticsArray) {
            
            NSString *subscriptionDatePurchased = subscriptionDict[@"SubscriptionDatePurchased"];
            NSString *subscriptionDateCancelled = subscriptionDict[@"SubscriptionDateCancelled"];
            NSString *subscriptionPrice = subscriptionDict[@"SubscriptionPrice"];
         
            NSDate *subscriptionCancelledInDateForm = [[[GeneralObject alloc] init] GenerateDateWithConvertedClassWithFormat:@"yyyy-MM-dd HH:mm:ss" dateToConvert:subscriptionDateCancelled returnAs:[NSDate class]];
            NSDate *subscriptionPurchasedInDateForm = [[[GeneralObject alloc] init] GenerateDateWithConvertedClassWithFormat:@"yyyy-MM-dd HH:mm:ss" dateToConvert:subscriptionDatePurchased returnAs:[NSDate class]];
            
            NSDate *subscriptionPurchasedPlusFreeTrialInDateForm = [[[GeneralObject alloc] init] GenerateDateWithAddedTimeWithFormat:@"yyyy-MM-dd HH:mm:ss" dateToAddTimeTo:subscriptionPurchasedInDateForm timeToAdd:60*60*24*7 returnAs:[NSDate class]];
          
            NSDate *endingPeriodInDateForm = [[[GeneralObject alloc] init] GenerateDateWithConvertedClassWithFormat:@"MMMM dd, yyyy hh:mm:ss a" dateToConvert:endingPeriodWeek returnAs:[NSDate class]];
            
            BOOL SubscriptionIsCancelledAfterStartOrEndOfMonthOrNotCancelled = ([self date:subscriptionCancelledInDateForm isAfter:startingDate andDate:endingDate] || [subscriptionDateCancelled isEqualToString:@""]);
            BOOL SubscriptionWasPurchasedAndPassedFreeTrialBeforeTheCutOffPeriod = [self date:subscriptionPurchasedPlusFreeTrialInDateForm isBefore:endingPeriodInDateForm andDate:endingPeriodInDateForm];
            BOOL SubscriptionPassedFreeTrialBeforeCancelledOrPassedFreeTrialIfNotCancelled =
            ([subscriptionDateCancelled isEqualToString:@""] == NO && [subscriptionCancelledInDateForm timeIntervalSinceDate:subscriptionPurchasedPlusFreeTrialInDateForm] > 0) ||
            ([subscriptionDateCancelled isEqualToString:@""] && [endingPeriodInDateForm timeIntervalSinceDate:subscriptionPurchasedPlusFreeTrialInDateForm] > 0);
            
            BOOL SessionIsWithinTheTimeFrame = SubscriptionIsCancelledAfterStartOrEndOfMonthOrNotCancelled == YES && SubscriptionWasPurchasedAndPassedFreeTrialBeforeTheCutOffPeriod == YES && SubscriptionPassedFreeTrialBeforeCancelledOrPassedFreeTrialIfNotCancelled == YES;
            
            //Found session within time frame
            if (SessionIsWithinTheTimeFrame == YES) {
                
                AmountOfUsersRetainedInTimeFrame += 1;
                
                subscriptionPrice = [[[GeneralObject alloc] init] GenerateStringWithRemovedSymbols:subscriptionPrice arrayOfSymbols:@[@"$"]];
                
                TotalPriceOfCountedSubscriptions += [subscriptionPrice doubleValue];
                
            }
            
        }
        
        //Save amount of users found for specific time frame
        [dictOfRetentionAmountsPerTimeFrame setObject:[NSString stringWithFormat:@"%d -- %.02f", AmountOfUsersRetainedInTimeFrame, TotalPriceOfCountedSubscriptions] forKey:[NSString stringWithFormat:@"%@ - %@", startingDateString, endingDateString]];
        AmountOfUsersRetainedInTimeFrame = 0;
        TotalPriceOfCountedSubscriptions = 0;
        
    }
    
    //Print result
    NSLog(@"SubscriptionChurnEnd - (%@)\n%@", cohortWeek, dictOfRetentionAmountsPerTimeFrame);
    
}

-(void)SubscriptionFreeTrialChurn:(NSArray *)mixPanelID weekDict:(NSDictionary *)weekDict cohortWeek:(NSString *)cohortWeek endingPeriodWeek:(NSString *)endingPeriodWeek userAnalyticsArray:(NSMutableArray *)userAnalyticsArray {
    
    NSMutableDictionary *dictOfRetentionAmountsPerTimeFrame = [NSMutableDictionary dictionary];
    __block int AmountOfSubscriptionsPassedFreeTrialRetainedInTimeFrame = 0;
    
    NSDateFormatter *dateFormatter = [[NSDateFormatter alloc] init];
    [dateFormatter setLocale:[NSLocale currentLocale]];
    
    NSDate *startingDate;
    NSDate *endingDate;
    
    //Loop through each time frame
    for (NSString *startingDateString in [weekDict allKeys]) {
        
        NSString *endingDateString = weekDict[startingDateString];
        
        [dateFormatter setDateFormat:@"MMMM dd, yyyy hh:mm:ss a"];
        startingDate = [dateFormatter dateFromString:startingDateString];
        endingDate = [dateFormatter dateFromString:endingDateString];
        
        
        
        
        for (NSDictionary *subscriptionDict in userAnalyticsArray) {
            
            NSString *subscriptionDatePurchased = subscriptionDict[@"SubscriptionDatePurchased"];
            NSString *subscriptionDateLastOpenned = subscriptionDict[@"SubscriptionDateLastOpenned"];
//           NSString *currentDate = [[[GeneralObject alloc] init] GenerateCurrentDateString];
            
            [dateFormatter setDateFormat:@"yyyy-MM-dd HH:mm:ss"];
            
            NSDate *subscriptionPurchasedInDateForm = [dateFormatter dateFromString:subscriptionDatePurchased];
            NSDate *subscriptionDateLastOpennedInDateForm = [dateFormatter dateFromString:subscriptionDateLastOpenned];
            
            BOOL SessionIsWithinTheTimeFrame = [self date:subscriptionPurchasedInDateForm isBetweenDate:startingDate andDate:endingDate];
            BOOL SubscriptionPassed7DayMark = [subscriptionDateLastOpennedInDateForm timeIntervalSinceDate:subscriptionPurchasedInDateForm] > 86400*7;
            
            //Found session within time frame
            if (SessionIsWithinTheTimeFrame == YES && SubscriptionPassed7DayMark == YES) {
                
                AmountOfSubscriptionsPassedFreeTrialRetainedInTimeFrame += 1;
               
            }
            
        }
        
        //Save amount of users found for specific time frame
        [dictOfRetentionAmountsPerTimeFrame setObject:[NSString stringWithFormat:@"%d", AmountOfSubscriptionsPassedFreeTrialRetainedInTimeFrame] forKey:[NSString stringWithFormat:@"%@ - %@", startingDateString, endingDateString]];
        AmountOfSubscriptionsPassedFreeTrialRetainedInTimeFrame = 0;
        
    }
    
    //Print result
    NSLog(@"SubscriptionFreeTrialChurnEnd - (%@)\n%@", cohortWeek, dictOfRetentionAmountsPerTimeFrame);
    
}

