-(void)SignUpFunnelInitial:(NSArray *)arrayOfUsers cohortUsersDict:(NSDictionary *)allDict cohortWeek:(NSString *)cohortWeek completionHandler:(void (^)(BOOL finished, NSMutableDictionary *finalDict))finishBlock {
    
    NSMutableArray *userAnalyticsArray = [NSMutableArray array];
    
    FIRFirestore *defaultFirestore = [FIRFirestore firestore];
    NSMutableArray *objectArr = [NSMutableArray array];
    NSMutableDictionary *weekDictToUse = allDict[arrayOfUsers];
    
    [[NSUserDefaults standardUserDefaults] setObject:[NSMutableDictionary dictionary] forKey:@"SignUpPages"];
    
    for (NSString *str in arrayOfUsers) {
        
        [[[defaultFirestore collectionWithPath:@"Analytics"] queryWhereField:@"MixPanelID" isEqualTo:str] getDocumentsWithCompletion:^(FIRQuerySnapshot * _Nullable snapshot, NSError * _Nullable error) {
            
            for (FIRDocumentSnapshot *doc in snapshot.documents) {
                
                [userAnalyticsArray addObject:doc.data];
                
            }
            
            if ([[[GeneralObject alloc] init] AddToObjectArrAndCheckIfQueryHasEnded:[arrayOfUsers mutableCopy] objectArr:objectArr]) {
                
                [self SignUp:arrayOfUsers weekDict:weekDictToUse cohortWeek:cohortWeek GettingEmails:NO userAnalyticsArray:userAnalyticsArray completionHandler:^(BOOL finished, NSMutableDictionary *finalDict) {
                    
                    finishBlock(YES, finalDict);
                    
                }];
                
            }
            
        }];
        
    }
    
}

-(void)SignUp:(NSArray *)mixPanelID weekDict:(NSDictionary *)weekDict cohortWeek:(NSString *)cohortWeek GettingEmails:(BOOL)GettingEmails userAnalyticsArray:(NSMutableArray *)userAnalyticsArray completionHandler:(void (^)(BOOL finished, NSMutableDictionary *finalDict))finishBlock {
    
    NSMutableDictionary *finalDict = [NSMutableDictionary dictionary];
    
    NSMutableDictionary *dictOfRetentionAmountsPerTimeFrame = [NSMutableDictionary dictionary];
    __block int AmountOfUsersRetainedInTimeFrame = 0;
    
    NSDateFormatter *dateFormatter = [[NSDateFormatter alloc] init];
    [dateFormatter setLocale:[NSLocale currentLocale]];
    
    NSDate *startingDate;
    NSDate *endingDate;
    
    //Loop through each time frame
    for (NSString *startingDateString in [weekDict allKeys]) {
        
        NSString *endingDateString = weekDict[startingDateString];
        
        [dateFormatter setDateFormat:@"MMMM dd, yyyy hh:mm:ss a"];
        startingDate = [dateFormatter dateFromString:startingDateString];
        endingDate = [dateFormatter dateFromString:endingDateString];
        
        
        
        
        //Loop through each users analytics
        for (NSDictionary *specificUsersSessions in userAnalyticsArray) {
            
            NSUInteger indexOfSpecificUserSessions = [userAnalyticsArray indexOfObject:specificUsersSessions];
            
            NSArray *specificUsersSessionKeys = [specificUsersSessions allKeys];
            
            
            
            
            //Loop through specific users sessions
            for (NSString *sessionKey in specificUsersSessionKeys) {
                
                if (![sessionKey isEqualToString:@"MixPanelID"]) {
                    
                    [dateFormatter setDateFormat:@"MMMM dd, yyyy hh:mm:ss a"];
                    
                    NSDate *sessionKeyInDateForm = [dateFormatter dateFromString:sessionKey];
                    
                    BOOL SessionIsWithinTheTimeFrame = [self date:sessionKeyInDateForm isBetweenDate:startingDate andDate:endingDate] && sessionKeyInDateForm != nil;
                    
                    
                    
                    
                    //Found session within time frame
                    if (SessionIsWithinTheTimeFrame == YES) {
                        
                        BOOL CountRetention = false;
                        
                        NSDictionary *specificSession = specificUsersSessions[sessionKey];
                        NSArray *specificSessionPageOpennedKeys = [specificSession allKeys];
                        
                        specificSessionPageOpennedKeys = [specificSessionPageOpennedKeys sortedArrayUsingSelector:@selector(localizedCaseInsensitiveCompare:)];
                        
                        //Loop through specific page opennings in specific session
                        for (NSString *specificPageOpennedKey in specificSessionPageOpennedKeys) {
                            
                            NSDictionary *specificPageOpennedDict = specificSession[specificPageOpennedKey];
                            
                            NSString *viewController = specificPageOpennedDict[@"ViewController"];
                            
                            if ([[NSUserDefaults standardUserDefaults] objectForKey:@"SignUpPages"]) {
                                
                                [finalDict setObject:@"1" forKey:[NSString stringWithFormat:@"%@ -- %@", viewController, [NSString stringWithFormat:@"%lu", indexOfSpecificUserSessions]]];
                                
                                [[NSUserDefaults standardUserDefaults] setObject:finalDict forKey:@"SignUpPages"];
                            }
                            
                        }
                        
                        if (CountRetention == true) {
                            
                            AmountOfUsersRetainedInTimeFrame += 1;
                            break;
                            
                        }
                        
                    }
                    
                }
                
            }
            
        }
        
        //Save amount of users found for specific time frame
        [dictOfRetentionAmountsPerTimeFrame setObject:[NSString stringWithFormat:@"%d", AmountOfUsersRetainedInTimeFrame] forKey:[NSString stringWithFormat:@"%@ - %@", startingDateString, endingDateString]];
        AmountOfUsersRetainedInTimeFrame = 0;
        
    }
    
    //Print result
    NSLog(@"RetentionEnd - (%@)\n%@", cohortWeek, dictOfRetentionAmountsPerTimeFrame);
    
    finishBlock(YES, finalDict);
}

#pragma mark

-(void)GenerateSignUpEnd:(NSMutableDictionary *)dictOfViewControllerVisitAmounts weekName:(NSString *)weekName {
    
    NSMutableDictionary *dictOfViewControllerResults = [NSMutableDictionary dictionary];
    
    for (NSString *viewControllerKey in dictOfViewControllerVisitAmounts) {
        
        NSString *viewController = [viewControllerKey componentsSeparatedByString:@" -- "][0];
        NSString *viewControllerAmount = dictOfViewControllerResults[viewController] ? [NSString stringWithFormat:@"%d", [dictOfViewControllerResults[viewController] intValue] + 1] : @"1";
        
        [dictOfViewControllerResults setObject:viewControllerAmount forKey:viewController];
        
    }
    
    float totalInactiveUsers = 0.0;
    
    for (NSString *viewController in [dictOfViewControllerResults allKeys]) {
        
        if ([viewController containsString:@"InitialView"]) {
            totalInactiveUsers += [dictOfViewControllerResults[viewController] intValue];
        }
        
    }
    
    for (NSString *viewController in [dictOfViewControllerResults allKeys]) {
        
        if ([viewController containsString:@"InitialView"] == NO) {
            
            float percentageOfInactiveUsersPerViewController = ([dictOfViewControllerResults[viewController] floatValue] / totalInactiveUsers)*100;
            NSString *amountOfInactiveUsersPerViewController = dictOfViewControllerResults[viewController];
            
            [dictOfViewControllerResults setObject:[NSString stringWithFormat:@"%0.2f (%@)", percentageOfInactiveUsersPerViewController, amountOfInactiveUsersPerViewController] forKey:viewController];
            
        }
        
    }
    
    NSLog(@"SignUpEnd %@ %@", weekName, dictOfViewControllerResults);
    
}


#pragma mark - Analytics

- (BOOL)date:(NSDate*)date isBetweenDate:(NSDate*)beginDate andDate:(NSDate*)endDate
{
    if ([date compare:beginDate] == NSOrderedAscending)
        return NO;
    
    if ([date compare:endDate] == NSOrderedDescending)
        return NO;
    
    return YES;
}

- (BOOL)date:(NSDate*)date isAfter:(NSDate*)beginDate andDate:(NSDate*)endDate
{
    if ([date compare:beginDate] == NSOrderedAscending)
        return NO;
    
    if ([date compare:endDate] == NSOrderedAscending)
        return NO;
    
    return YES;
}

- (BOOL)date:(NSDate*)date isBefore:(NSDate*)beginDate andDate:(NSDate*)endDate
{
    if ([date compare:beginDate] == NSOrderedDescending)
        return NO;
    
    if ([date compare:endDate] == NSOrderedDescending)
        return NO;
    
    return YES;
}

